import React from 'react';
import Main from './pages/Main';
import {createGlobalStyle} from "styled-components";

const GlobalStyle=createGlobalStyle`
*{
  margin:0;
  padding:0;
}

body{
  background-color:black;
}
`;

function App() {
  return (
    <>
      <GlobalStyle/>
      <Main/>
    </>
  );
}

export default App;
